import { useEffect, useState } from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import './App.css';
import BoardAgent from './components/BoardAgent';
import BoardClient from './components/BoardClient';
import Login from './components/Login';
import Profile from './components/Profile';
import AuthService from './services/auth.service';

function App() {

  const [showAgentBoard, setShowAgentBoard] = useState(false);
  const [showClientBoard, setShowClientBoard] = useState(false);
  const [currentUser, setCurrentUser] = useState(undefined);

  useEffect(() => {
    const user = AuthService.getCurrentUser();
    if(user){
      setCurrentUser(user);
      setShowAgentBoard(user.roles.includes("ROLE_AGENT"));
      setShowClientBoard(user.roles.includes("ROLE_CLIENT"));
    }
  }, [])

  const logout = () => {
    AuthService.logout();
  }
  return (
    <div>
       <nav className="navbar navbar-expand-md navbar-dark bg-dark">
        <Link to={""} className="navbar-brand">
          InsuranceMS
        </Link>
        <div className="navbar-nav mr-auto">
          {showAgentBoard && (
            <li className="nav-item">
              <Link to={"/agent"} className="nav-link">
                Agent Board
              </Link>
            </li>
          )}

          {showClientBoard && (
            <li className="nav-item">
              <Link to={"/client"} className="nav-link">
                Client Board
              </Link>
            </li>
          )}

          {currentUser && (
            <li className="nav-item">
              <Link to={"/user"} className="nav-link">
                User
              </Link>
            </li>
          )}
        </div>

        {currentUser ? (
          <div className="navbar-nav ml-auto">
            <li className="nav-item">
              <Link to={"/profile"} className="nav-link">
                {currentUser.username}
              </Link>
            </li>
            <li className="nav-item">
              <a href="/login" className="nav-link" onClick={logout}>
                Logout
              </a>
            </li>
          </div>
        ) : (
          <div className="navbar-nav ml-auto">
            <li className="nav-item">
              <Link to={"/login"} className="nav-link">
                Login
              </Link>
            </li>
          </div>
        )}
      </nav>
      <div className="container mt-3">
        <Routes>
          <Route path="/login" element={<Login/>} />
          <Route path="/profile" element={<Profile/>} />
          <Route path="/client" element={<BoardClient/>} />
          <Route path="/agent" element={<BoardAgent/>} />
        </Routes>
      </div>
      <div class="jumbotron ">
        <h1 class="display-4">Hello, world!</h1>
        <p class="lead">Streamlining Your Insurance Management Needs</p>
        <hr class="my-4"/>
        <p>This system allows insurers to store and access customer information, policy details, and claims data all in one place. Users can easily search, view, edit policies and track claims.</p>
        <a class="btn btn-primary btn-lg" href="#" role="button">Learn more</a>
      </div>
      <footer className="AppFooter">
        <div>InsuranceMs Â©2023 Created by Carina Nechita</div>
      </footer>
    </div>
  );
}

export default App;
